export default function EmployerLanding() {
    return(
        <div className="container">
            <div className="row">
                <div className="col-12 center-row display-center">
                    <div className="landing-employer-main-text">
                        <p className="main-landing-text">Знаходьте молоді таланти</p>
                    </div>
                    <div className="landing-employer-main-button">
                        <button className="employer-landing-button">Розмістити вакансію</button>
                    </div>
                </div>
            </div>
        </div>

    )
}
